import styled from "styled-components";

export const Container = styled.div`
  padding: 0px;
  min-width: 300px;
  max-width: 440px;
  background-color: black;
  border-radius: 12px;
  display: flex;
  position: relative;
  margin: 50px;
  color: #ffffff;
`;
